    @classmethod
    def get_test_image(cls) -> Image:
        return Image.from_data(base64.decodebytes(cls.TEST_DICT_STORE_IMAGE.encode()))

    @classmethod
    def get_test_audio(cls) -> Audio:
        return Audio.from_data(base64.decodebytes(cls.TEST_DICT_STORE_AUDIO.encode()))

    @staticmethod
    def SubjectArgs(
            options: OptionsList,
            *,
            source: Optional[Iterable] = None,
            sink: Optional[ThenFunction] = None
    ):
        return BaseSubjectArgs(options, source, sink)

    @classmethod
    def subject_type(cls):
        def create_pipeline(options, source=None, sink=None):
            pipeline = ConversionPipelineBuilder.from_options(options)
            return lambda: pipeline.process(source, sink)

        return create_pipeline
